import jsPDF from 'jspdf'
;(function (jsPDFAPI) {
  var font =
    ''
  var callAddFont = function () {
    this.addFileToVFS('DarkerGrotesque-Bold-bold.ttf', font)
    this.addFont('DarkerGrotesque-Bold-bold.ttf', 'DarkerGrotesque-Bold', 'bold')
  }
  jsPDFAPI.events.push(['addFonts', callAddFont])
})(jsPDF.API)
